      description="Pagina para crear una clase nueva"
    >
      <Container maxWidth="md">
        <Grid container direction="column" spacing={8}>
          <Grid item>
            
          </Grid>
          
        </Grid>
      </Container>
    </Layout>
  );
};

export default EditorDePasos;
